import { 
    SIGN_IN, 
    SIGN_OUT,
} from './types';

const admin = '104068328308971597103'

export const signIn = (userId, name) => {
    if(userId === admin)
        return {
            type: SIGN_IN,
            payload: userId,
            isAdmin: true,
            payload: name
        }
    else
        return {
            type: SIGN_IN,
            payload: userId,
            isAdmin: false
            }
};

export const signOut = () => {
    return {
        type: SIGN_OUT
    };
};
